window.bookSummaryJSON = "<p><b>A new series in the New Era Online universe from the author who brought you </b><b><i>Life Reset!</i></b></p> <p><b>John Slater never had any interest in video games. Now he’s got to beat one to save his brother.</b></p> <p>A battle-hardened, ex-special forces soldier, John was never a fan of games...unlike his brother. But now, he’s got to learn and learn fast if he has any chance of saving his younger sibling. Magic, monsters and levels are new to him, and his real-world skills aren’t as useful as he thinks.</p> <p>Lucky for him, he’s used to adapting on the fly. And soon, the world will know why his squadmates called him Seraph, the death angel.</p> <p><i>Note: Events in Biomancer happen after Life Reset. However, the two plot lines are not directly connected and can be listened to independently.</i></p>"; 
